import React from 'react';

import Footer from '../../components/layouts/footer/Footer';
import Navbar from '../../components/layouts/navbar/Navbar';
import SignUp from '../../components/singup/SignUp';

const SignUpPage = () => {
  return (
    <div>
     <Navbar/>
     <SignUp/>
     <Footer/>
    </div>
  )
}

export default SignUpPage
